oxy_webhelp_navlinks = {"azure_archive_tiering-d22872e5759":{"topics":[{"title":"Displaying smart tiering details for Azure workloads","shortdesc":"<p class=\"shortdesc\">Viewing SLA Domains in Storage Tiering in <span class=\"ph\">RSC<\/span> is only possible when         they have already been configured in CDM with smart tiering enabled for Azure archival         locations. <span class=\"ph\">RSC<\/span> does not support the configuration of new smart tiering         policies for SLA Domains.<\/p>","href":"archival\/arch_displaying_smart_tiering_azr.html","attributes":{"data-id":"arch_displaying_smart_tiering_azr"},"menu":{"hasChildren":false},"tocID":"arch_displaying_smart_tiering_azr-d22872e5770","topics":[]},{"title":"Editing smart tiering for Azure workloads","shortdesc":"<p class=\"shortdesc\">You can modify the minimum retention period for snapshots of SLA Domains configured         with smart tiering for Azure workloads. Additionally, you can switch from smart tiering to         other storage tiering options.<\/p>","href":"archival\/arch_editing_smart_tiering_azr.html","attributes":{"data-id":"arch_editing_smart_tiering_azr"},"menu":{"hasChildren":false},"tocID":"arch_editing_smart_tiering_azr-d22872e5787","topics":[]}]}};